import React, { PureComponent } from 'react';
import {
    LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';

import data from '../fixture';


export default class Example extends PureComponent {
    static jsfiddleUrl = 'https://jsfiddle.net/alidingling/xqjtetw0/';

    render() {
      return (
        <LineChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 5, right: 30, left: 20, bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="ars" stroke="#8884d8" activeDot={{ r: 8 }} />
          <Line type="monotone" dataKey="pfijo" stroke="#82ca9d" />
          <Line type="monotone" dataKey="usd" stroke="#8884d8" activeDot={{ r: 8 }} />
          <Line type="monotone" dataKey="btc" stroke="#82ca9d" />
        </LineChart>
      );
    }
  }
